window.bookSummaryJSON = "<p><i>USA Today</i> best-selling author, Deanna Chase, brings you book three of the Jade Calhoun series.</p> <p>New Orleans coven leader, Jade Calhoun, is embarking on a Hellish mission. Literally. A week ago her ex sacrificed himself to Hell in order to save Jade’s mother. While he suffers, Jade will stop at nothing to bring him home...even if it means working with Lailah, an angel she’s never trusted.</p> <p>But the stakes are raised when Jade discovers her boyfriend, Kane, is marked by a demon. The very same one who tried seducing him right before Jade’s eyes. Now Kane’s life is on the line, and consequently, Jade’s soul is compromised. She’ll need all the help she can get, including Lailah’s, as she fights her way through Hell to save her ex and Kane - and her entire existence.</p>"; 
